import React, { useEffect, useState } from 'react';

export const ListeEnchere = () => {

    const [items, setItems] = useState();


  useEffect(() => {
    fetch('http://172.16.1.105:8080/Enchere',
    { method: "GET" })
    .then((response)=>response.json())
    .then((json)=>setItems(json.data));
  },[]);

  return (
    <>
    <h2>Liste des Enchere</h2>
        {items.map((item) => {
            return (
                <tr>
                    <td>{item.id}</td>
                    <td>{item.idproduit}</td>
                    <td>{item.idclient}</td>
                    <td>{item.montantenchere}</td>
                </tr>
            )
        })}
    </>
  );
}

export default ListeEnchere;
